  from discrete sample and profile observations using CTD, bottle and other instruments
  from the METEOR in the Caribbean Sea and North Atlantic Ocean from 2004-07-10 to
  2004-08-07 (NODC Accession 0116644)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
