  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116644 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the Caribbean
  Sea and North Atlantic Ocean from 2004-07-10 to 2004-08-07 and retrieved during
  cruise MT62-1 and WOCE_AR04_06MT20040710. These data include CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  Potential temperature (theta), SALINITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD and bottle. These data were collected by Monika
  Rhein and R. Steinfeldt of Universitaet Bremen as part of the WOCE_AR04_06MT20040710
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
